INSERT INTO `stories` VALUES (2,'Sophia','I\'m Sophia. I have SMA. My disease was selected by the NIH as the condition \"closest to treatment\". Think. Your free vote could win $1M for SMA research. CURE a disease. SAVE lives. SAVE children.',1,'SophiaTwitter.gif','image/gif',5997,'2010-01-12 17:03:53','2010-01-12 17:03:53','2010-01-13 23:37:59'),(3,'Gwendolyn','I\'m Gwendolyn. I have SMA. At 2-years-old, I\'ve outlived most of my peers with SMA. I\'m completely paralyzed and require machines to eat, swallow, cough, and breathe. A cure is possible and your free vote will help make it a reality.',1,'GwendolynTwitter.gif','image/gif',5382,'2010-01-12 17:04:23','2010-01-12 17:04:23','2010-01-14 02:50:53'),(4,'Nicholas','I\'m Nicholas. I have SMA. Although not a household name, SMA kills more young children than any other genetic disease. Your vote will help END it. Forever.',1,'NicholasTwitter.gif','image/gif',6468,'2010-01-12 17:04:41','2010-01-12 17:04:41','2010-01-13 23:33:22'),(5,'Lucy','I\'m Lucy. I have SMA. I just celebrated my first birthday and according to statistics, I am lucky to have seen it. Please vote for the Gwendolyn Strong Foundation to make my dream of a cure for SMA a reality. ',1,'LucyTwitter.gif','image/gif',6382,'2010-01-12 17:05:01','2010-01-12 17:05:01','2010-01-14 03:02:54'),(6,'Karson','I\'m Karson. I have SMA. Did you know 1 in 40 people unknowingly carries the SMA gene. That could be YOU. That could be YOUR child. Please vote to make a $1M miracle a reality for SMA research.',1,'BabyTwitter.gif','image/gif',5869,'2010-01-12 17:05:59','2010-01-12 17:05:59','2010-01-13 23:34:30'),(7,'Nora','I\'m Nora. I have SMA. Researchers have stressed that a CURE for SMA is possible in 5 years -- with adequate funding. This $1M will help CURE SMA. Vote today to make this MIRACLE a reality.',1,'NoraTwitter.gif','image/gif',6350,'2010-01-12 17:06:17','2010-01-12 17:06:17','2010-01-13 23:36:19');
/*!40000 ALTER TABLE `stories` ENABLE KEYS */;
